import { Facebook, GitHub, Instagram, Twitter, WhatsApp } from "@material-ui/icons";
import styled from "styled-components"

const Container = styled.div`
    display: flex;
`;

const Left = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    padding: 20px;
`;

const Logo = styled.h1``;

const Desc = styled.p`
    margin: 20px 0px;
    line-height: 25px;
    word-spacing: 10px;
`;

const SocialContainer = styled.div``;

const SocialIcon = styled.div``;

const Center = styled.div`
    flex: 1;
`;

const Right = styled.div`
    flex: 1;
`;

const Footer = () => {
  return (
    <Container>
      <Left>
          <Logo>Jean.</Logo>
          <Desc>
          In publishing and graphic design, Lorem 
          ipsum is a placeholder text commonly used to 
          demonstrate the visual form of a document or a typeface withou
          </Desc>
          <SocialContainer>
              <SocialIcon>
                  <Facebook />
              </SocialIcon>
              <SocialIcon>
                  <Twitter />
              </SocialIcon>
              <SocialIcon>
                  <Instagram />
              </SocialIcon>
              <SocialIcon>
                  <GitHub />
              </SocialIcon>
              <SocialIcon>
                  <WhatsApp />
              </SocialIcon>
          </SocialContainer>
      </Left>
      <Center></Center>
      <Right></Right>
    </Container>
  )
}

export default Footer
